// SPDX-License-Identifier: MIT

pragma solidity >=0.7.0 <0.9.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract CodeMavricksNft is ERC721Enumerable, Ownable {
    using Strings for uint256;

    string public baseURI;
    string public baseExtension = ".json";
    //we need to remove this comment in the production
    // uint256 public cost = 1 ether;
    uint256 public maxSupply = 10000;
    bool public paused = false;

    // Define a moderator group
    address[] public moderators;

    mapping(address => uint) public nftScores;
    mapping(address => string[]) public nftContributions;

    constructor(
        string memory _name,
        string memory _symbol,
        string memory _initBaseURI
    ) ERC721(_name, _symbol) {
        setBaseURI(_initBaseURI);
        mint(owner());
    }

    // internal
    function _baseURI() internal view virtual override returns (string memory) {
        return baseURI;
    }

    // public
    function mint(address receiver) public payable {
        require(!paused, "the contract is paused");
        uint256 supply = totalSupply() + 1;
        require(supply <= maxSupply, "max NFT limit exceeded");
        require(balanceOf(receiver) == 0, "only one nft per user");
    //we need to remove this comment in the production

        // if (msg.sender != owner()) {
        //     require(msg.value >= cost, "insufficient funds");
        // }

        nftScores[receiver] = 0;
        _safeMint(receiver, supply);
    }

    function getNFTContributions(
        address owner
    ) public view returns (string[] memory) {
        return nftContributions[owner];
    }

    function transferNFTContributions(address owner, address newOwner) public {
        require(
            owner != newOwner,
            "The new owner cannot be the same as the current owner"
        );

        uint256 commentCount = nftContributions[owner].length;
        for (uint256 i = 0; i < commentCount; i++) {
            nftContributions[newOwner].push(nftContributions[owner][i]);
        }

        delete nftContributions[owner];
    }

    // Function to update the score of an NFT
    function updateScore(address owner, string memory comment) public {
        // Make sure the caller is a moderator
        require(isModerator(msg.sender), "Unauthorized");

        // Make sure the NFT exists
        uint256 nftIndex = tokenOfOwnerByIndex(owner, 0);
        require(nftIndex != 0, "NFT does not exist");

        // Update the score
        nftScores[owner] += 10;
        nftContributions[owner].push(comment);
    }

    // Helper function to check if an address is a moderator
    function isModerator(address _address) public view returns (bool) {
        for (uint256 i = 0; i < moderators.length; i++) {
            if (moderators[i] == _address) {
                return true;
            }
        }
        return false;
    }

    function addModerator(address newModerator) public {
        require(
            isModerator(msg.sender) || msg.sender == owner(),
            "Unauthorized"
        );
        moderators.push(newModerator);
    }

    function walletOfOwner(
        address _owner
    ) public view returns (uint256[] memory) {
        uint256 ownerTokenCount = balanceOf(_owner);
        uint256[] memory tokenIds = new uint256[](ownerTokenCount);
        for (uint256 i; i < ownerTokenCount; i++) {
            tokenIds[i] = tokenOfOwnerByIndex(_owner, i);
        }
        return tokenIds;
    }

    function tokenURI(
        uint256 tokenId
    ) public view virtual override returns (string memory) {
        require(
            _exists(tokenId),
            "ERC721Metadata: URI query for nonexistent token"
        );

        string memory currentBaseURI = _baseURI();
        return
            bytes(currentBaseURI).length > 0
                ? string(
                    abi.encodePacked(
                        currentBaseURI,
                        "/",
                        tokenId.toString(),
                        baseExtension
                    )
                )
                : "";
    }

    // function setCost(uint256 _newCost) public onlyOwner {
    //     cost = _newCost;
    // }

    function setBaseURI(string memory _newBaseURI) public onlyOwner {
        baseURI = _newBaseURI;
    }

    function setBaseExtension(
        string memory _newBaseExtension
    ) public onlyOwner {
        baseExtension = _newBaseExtension;
    }

    function pause(bool _state) public onlyOwner {
        paused = _state;
    }

    function setScore(address user, uint score) external {
        nftScores[user] = score;
    }

    function getScore(address user) external view returns (uint) {
        return nftScores[user];
    }

    function tokenExists(uint256 tokenId) public view returns (bool) {
        return _exists(tokenId);
    }

    //To-Do : make this withdraw multisig
    function withdraw() public payable onlyOwner {
        (bool os, ) = payable(owner()).call{value: address(this).balance}("");
        require(os);
    }
}
